import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div class="card justify-content-center">
    <div class="card-body">
      <h5 class="card-title">Clicky Game!</h5>
      <p class="card-text">Click on an image to earn points, but don't click on any more than once!.</p>

    </div>
  </div>
  );
}

export default App;
